import React from 'react'
import FormikControl from '../FormComponents/FormikControl'

function GlobalFilter({filter,setFilter}) {
    return (
        <span>
           <FormikControl 
           control="input"
           type="text"
           value={filter || ""}
           onChange={e=>setFilter(e.target.value)}
           label="Search"
           />
        </span>
    )
}

export default GlobalFilter
